import React from 'react';
import styled from '@emotion/native';

type SigninRedirectButtonProps = {
    title: string;
    handlePress: () => void; 
};

export default function SigninRedirectButton({ title, handlePress }: SigninRedirectButtonProps){
    return (
        <RedirectButton 
            title={title}
            onPress={handlePress}
        />
    )
}

const RedirectButton = styled.button`
    background: white;
    border: 1px solid #428af5;
    margin: 10% 0;
`;
